// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract selling{
    struct picture{
        address picture_nft;
        uint highestprice;
        uint startprice;
        address payable highest_bidder;
        uint picture_id;
        bool onsell;
        uint deadline;
    }
    uint public picture_num;
    mapping(uint=>address) public all_picture_owner;
    picture [] public all_picture;
    function createPicture(address _pictureNft) public returns(uint){
        uint id;
        all_picture.push(picture(_pictureNft,0,0,payable(msg.sender),0,false,0));
        id=all_picture.length-1;
        picture_num=all_picture.length;
        all_picture[id].picture_id=id;
        all_picture_owner[id]=msg.sender;
        return id;
    }
    function getPictureByAddress(address _pictureNft) private view returns (uint){
        for(uint i=0;i<all_picture.length;i++)
        {
            if(all_picture[i].picture_nft==_pictureNft)
            {
                return i;
            }
        }
    }
    function auction(address _pictureNft,uint _startPrice,uint _deadline)public{
        picture storage devote=all_picture[getPictureByAddress(_pictureNft)];
        require(msg.sender==all_picture_owner[devote.picture_id]);
        devote.onsell=true;
        devote.startprice=_startPrice;
        devote.deadline=_deadline;
    }
    modifier bidIsreasonable(address _pictureNft,uint price)
    {
        picture memory devote=all_picture[getPictureByAddress(_pictureNft)];
        require(msg.value>0);
        require(price<msg.value);
        require(devote.onsell!=false);
        require(block.timestamp<=devote.deadline);
        require(devote.highestprice<price);
        _;
    }
    function bid(address _pictureNft,uint _price)public payable bidIsreasonable(_pictureNft,_price){
        picture storage devote=all_picture[getPictureByAddress(_pictureNft)];
        devote.highestprice=_price;
        devote.highest_bidder=payable(msg.sender);
    }
    function auctionConfirm(address _pictureNft)public payable returns(bool){
        
        uint picture_id=getPictureByAddress(_pictureNft);
        picture storage devote=all_picture[picture_id];
        require(devote.highest_bidder==msg.sender);
        address payable preOwner=payable(all_picture_owner[picture_id]);
        preOwner.transfer(devote.highestprice);
        devote.startprice=0;
        devote.highestprice=0;
        devote.onsell=false;
        devote.deadline=0;
        return true;
    }
    function cancel_auction(address _pictureNft)public{
        uint picture_id=getPictureByAddress(_pictureNft);
        picture storage devote=all_picture[picture_id];
        require(all_picture_owner[picture_id]==msg.sender);
        devote.deadline=0;
        devote.highest_bidder=payable(msg.sender);
        devote.highestprice=0;
        devote.onsell=false;
        devote.startprice=0;
    }
    function getBalance() public view returns (uint){
        return address(this).balance;
    }
}
